// src/utils/exportUtils.js
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { utils, writeFile } from 'xlsx';

const logoBase64 = "data:image/png;base64,"; // Tu logo

export const exportToPDF = (audit, checklist) => {
    if (!audit) {
        alert("Por favor, selecciona una auditora para exportar.");
        return;
    }

    const doc = new jsPDF();
    doc.addImage(logoBase64, 'PNG', 150, 8, 45, 25); // Ajusta las coordenadas (x,y) y tamao (ancho,alto) segn necesites

    const tableData = [];
    const tableColumns = ["Requisito", "Descripcin", "Resultado", "Comentarios"];

    // --- 1. Encabezado de la Auditora (sin cambios) ---
    doc.setFontSize(18);
    doc.text(`Auditora: ${audit.numeroAuditoria}`, 14, 22);
    doc.setFontSize(11);
    doc.text(`Lugar: ${audit.lugar}`, 14, 30);
    doc.text(`Auditores: ${audit.auditores.join(', ')}`, 14, 36);
    doc.text(`Auditados: ${audit.auditados.join(', ')}`, 14, 42);
    doc.text(`Fecha Inicio: ${audit.fechaCreacion.toDate().toLocaleDateString()}`, 14, 48);
    doc.text(`Fecha Cierre: ${audit.fechaCierre ? audit.fechaCierre.toDate().toLocaleDateString() : 'Abierta'}`, 14, 54);

    // --- 2. Preparar Datos para la Tabla (sin cambios) ---
    Object.values(checklist).forEach(pilar => {
        tableData.push([{ content: `--- PILAR: ${pilar.nombre} (${pilar.id}) ---`, colSpan: 4, styles: { fontStyle: 'bold', fillColor: [220, 220, 220] } }]);
        Object.values(pilar.estandares).forEach(estandar => {
            tableData.push([{ content: `Estndar: ${estandar.descripcion} (${estandar.id})`, colSpan: 4, styles: { fontStyle: 'italic', fillColor: [240, 240, 240] } }]);
            estandar.requisitos.forEach(req => {
                const result = audit.resultados.find(r => r.requisitoId === req.id);
                // --- LGICA MODIFICADA PARA LA COLUMNA DE RESULTADO ---
                let resultadoTexto = result?.resultado || 'Pendiente';
                if (result && result.adjuntos && result.adjuntos.length > 0) {
                    resultadoTexto += ' (Ver Evidencias)'; // Aadimos la nota
                }
                tableData.push([
                    req.id,
                    req.requerimientoOperacional,
                    result?.resultado || 'Pendiente',
                    result?.comentarios || ''
                ]);
            });
        });
    });

    // --- 3. Dibujar la Tabla ---
    autoTable(doc, {
        head: [tableColumns],
        body: tableData,
        startY: 60,
        styles: { fontSize: 8 },
        headStyles: { fillColor: [52, 142, 68] }
    });

    // --- 4. NUEVA SECCIN: Calcular y Aadir Resumen de Resultados ---
    let finalY = doc.lastAutoTable.finalY || 60; // Posicin Y despus de la tabla
    
    const totalPuntosAuditados = audit.resultados.length;
    if (totalPuntosAuditados > 0) {
        const conformes = audit.resultados.filter(r => r.resultado === 'C').length;
        const noConformes = audit.resultados.filter(r => r.resultado === 'NC').length;
        const noObservados = audit.resultados.filter(r => r.resultado === 'NO').length;

        const pConformes = ((conformes / totalPuntosAuditados) * 100).toFixed(1);
        const pNoConformes = ((noConformes / totalPuntosAuditados) * 100).toFixed(1);
        const pNoObservados = ((noObservados / totalPuntosAuditados) * 100).toFixed(1);

        doc.addPage(); // Aadimos una nueva pgina para el resumen y las firmas
        finalY = 20; // Reiniciamos la posicin Y en la nueva pgina

        doc.setFontSize(14);
        doc.text("Resumen de Resultados", 14, finalY);
        finalY += 10;
        
        doc.setFontSize(11);
        doc.text(`- Conformes (C): ${conformes} (${pConformes}%)`, 14, finalY);
        finalY += 7;
        doc.text(`- No Conformes (NC): ${noConformes} (${pNoConformes}%)`, 14, finalY);
        finalY += 7;
        doc.text(`- No Observados (NO): ${noObservados} (${pNoObservados}%)`, 14, finalY);
        finalY += 7;
        doc.setFontSize(12);
        doc.text(`Total de Puntos Auditados: ${totalPuntosAuditados}`, 14, finalY);
    }
    
    // --- 5. NUEVA SECCIN: Aadir Espacios para Firmas ---
    
    // Mover la posicin Y hacia abajo para dejar espacio
    finalY += 40; 
    
    // Lnea para la firma del auditor
    doc.line(20, finalY, 80, finalY); // Dibuja una lnea de 60mm
    doc.text("Firma Auditor/es", 35, finalY + 5);

    // Lnea para la firma del responsable
    doc.line(120, finalY, 180, finalY); // Dibuja otra lnea
    doc.text("Firma Responsable Sucursal", 125, finalY + 5);

    // --- 6. Guardar el PDF (sin cambios) ---
    doc.save(`Auditoria_${audit.numeroAuditoria}.pdf`);
};

export const exportToXLS = (audit, checklist) => {
  if (!audit) {
      alert("Por favor, selecciona una auditora para exportar.");
      return;
  }

  const worksheetData = [
      ["Auditora:", audit.numeroAuditoria],
      ["Lugar:", audit.lugar],
      ["Auditores:", audit.auditores.join(', ')],
      ["Auditados:", audit.auditados.join(', ')],
      ["Fecha Inicio:", audit.fechaCreacion.toDate().toLocaleDateString()],
      ["Fecha Cierre:", audit.fechaCierre ? audit.fechaCierre.toDate().toLocaleDateString() : 'Abierta'],
      [], // Fila vaca para separar
      ["Pilar", "Estndar", "Requisito ID", "Descripcin", "Resultado", "Comentarios"]
  ];

  Object.values(checklist).forEach(pilar => {
      Object.values(pilar.estandares).forEach(estandar => {
          estandar.requisitos.forEach(req => {
              const result = audit.resultados.find(r => r.requisitoId === req.id);
              worksheetData.push([
                  `${pilar.nombre} (${pilar.id})`,
                  `${estandar.descripcion} (${estandar.id})`,
                  req.id,
                  req.requerimientoOperacional,
                  result?.resultado || 'Pendiente',
                  result?.comentarios || ''
              ]);
          });
      });
  });

  const workbook = utils.book_new();
  const worksheet = utils.aoa_to_sheet(worksheetData);
  utils.book_append_sheet(workbook, worksheet, "Auditora");
  writeFile(workbook, `Auditoria_${audit.numeroAuditoria}.xlsx`);
};

export const exportToPDF5S = (audit, checklist5S) => {
    if (!audit) {
        alert("Por favor, selecciona una auditora 5S para exportar.");
        return;
    }

    const doc = new jsPDF();
    // ... (lgica muy similar a exportToPDF, pero usando los datos de la auditora 5S)
    // Se crea la tabla con los items de la checklist 5S y sus resultados.
    
    // Header
    doc.setFontSize(18);
    doc.text(`Auditora 5S: ${audit.numeroAuditoria}`, 14, 22);
    // ... (ms detalles)

    // Tabla
    const tableColumns = ["tem", "Descripcin", "Resultado", "Comentarios"];
    const tableData = [];
    Object.entries(checklist5S).forEach(([seccion, items]) => {
        tableData.push([{ content: `--- SECCIN: ${seccion} ---`, colSpan: 4, styles: { fontStyle: 'bold' } }]);
        items.forEach(item => {
            const result = audit.resultados.find(r => r.itemId === item.id);
            tableData.push([
                item.id,
                item.text,
                result?.resultado || 'Pendiente',
                result?.comentarios || ''
            ]);
        });
    });

    autoTable(doc, { head: [tableColumns], body: tableData, startY: 60 });
    
    doc.save(`Auditoria_5S_${audit.numeroAuditoria}.pdf`);
};